Выборочная регистрация объектов – это режим дополнительной проверки, который используется при регистрации объектов (настраивается разработчиками программы).
Режим "Отключен" – все записываемые объекты считаются измененными и будут зарегистрированы к обмену;
Режим "Модифицированность" – регистрируем к обмену объекты, у которых были изменения в данных;
Режим "Согласно правилам xml" – к обменам регистрируем объекты, у которых есть изменения в реквизитах. Список реквизитов получается из правил конвертаций.
